import styled from "styled-components";

export const WrapperLayout = styled.section`
  margin: 16px;
  button {
    background-color: #f85313;
    box-shadow: 3px 2px 10px rgba(0, 0, 0, 0.5);
    padding: 8px 16px;
    margin: 0 16px;
    border-radius: 8px;

    &:hover {
      box-shadow: 3px 2px 10px rgba(0, 0, 0, 1);
    }
`;
